import React from 'react';
import aiIcon from '../assets/web-agenda/artificial-intelligence-04.png';
import sparklesIcon from '../assets/web-agenda/sparkles.png';
import noteDoneIcon from '../assets/web-agenda/note-done.png';
import addToListIcon from '../assets/web-agenda/add-to-list.png';
import arrowMoveIcon from '../assets/web-agenda/arrow-move-down-right.png';

const WebinarAgenda = () => {
  return (
    <section className="bg-gradient-to-b from-[#0C0C13] to-[#0F0C1E] py-20 px-4">
      <div className="max-w-6xl mx-auto text-white">
        {/* Left Column Title */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-12">
          <div className="md:col-span-1">
            <h3 className="text-gray-400 text-sm font-medium mb-3">Webinar Agenda</h3>
            <p className="text-2xl leading-snug font-medium text-white">
              Why traditional IT delivery models are failing in the AI era
            </p>
          </div>

          {/* Agenda Items */}
          <div className="md:col-span-2 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
            {/* Card 1 */}
            <div className="flex flex-col items-start space-y-3">
              <img src={sparklesIcon} alt="Sparkles Icon" className="w-6 h-6" />
              <p className="text-base font-medium text-white">
                Post-AI delivery standards you should demand from vendors
              </p>
            </div>

            {/* Card 2 */}
            <div className="flex flex-col items-start space-y-3">
              <img src={noteDoneIcon} alt="Checklist Icon" className="w-6 h-6" />
              <p className="text-base font-medium text-white">
                How to evaluate vendor AI claims with practical tests
              </p>
            </div>

            {/* Card 3 */}
            <div className="flex flex-col items-start space-y-3">
              <img src={aiIcon} alt="AI Icon" className="w-6 h-6" />
              <p className="text-base font-medium text-white">
                AI-readiness assessment for your Salesforce org
              </p>
            </div>

            {/* Card 4 */}
            <div className="flex flex-col items-start space-y-3">
              <img src={addToListIcon} alt="Checklist Icon" className="w-6 h-6" />
              <p className="text-base font-medium text-white">
                EXOâ€™s 3-step process for AI-speed delivery
              </p>
            </div>

            {/* Card 5 */}
            <div className="flex flex-col items-start space-y-3">
              <img src={arrowMoveIcon} alt="10x Icon" className="w-6 h-6" />
              <p className="text-base font-medium text-white">
                Real case studies of 3â€“10Ã— delivery acceleration
              </p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WebinarAgenda;
